import styled from "styled-components";


export const ContainerADMIN = styled.div `
	background-color: #8CF3F3;
	min-height: 100vh;
	width: 100%; 
	display: flex;
	flex-direction: row;
	height: 100%;
	/* ipads */
	@media (max-width: 720px) {
		flex-direction: column;
		width: 100%;

	}

`;
export const Nav = styled.div `
	display: flex;
	flex-direction: column;
	width: 10%;
	padding: 1em 1em 0em 1em;
    flex: 1 1 auto;


	@media screen and (max-width: 720px) {
		width: 85%;
		border: none;
		margin: 1em 2em 2em 1em;
		height: 100%;

	}
`;

export const ShowLogg = styled.div `
	display: flex;
	flex-direction: column;
	width: 20%;
	padding: 2em 2em;
	padding-bottom: 8em;
    flex: 1 1 auto;
	padding: 2em;
	background-color: #7ecfcf;

	@media screen and (max-width: 720px) {
		width: 91%;
		border: 2px solid black;
		margin: 1em 2em 2em 1em;
		height: 100%;
	}
`;

export const MapContainer = styled.div `
	display: flex;
	flex-direction: column;
	text-align: center;
	width: 65%;
	align-content: center;
	padding: 2em 2em;
	padding-bottom: 8em;
    flex: 1 1 auto;

	@media screen and (max-width: 720px) {
		flex-direction: row;
		padding: 1em;
		width: 100%;
		height: 100%;
		min-width: 250px;
	}
`;
